import React from 'react';


function Nav() {
  return(
    <nav className="purple lighten-3">
    <div className="nav-wrapper">
      <a href="#" class="brand-logo">Hit The Deck</a>
      <ul className="right hide-on-med-and-down">
        <li><a href="">Sign Up</a></li>
        <li><a href="">Login</a></li>
      </ul>
    </div>
  </nav>
  )


}

export default Nav;
